import React from 'react';

const ActivityItem = ({ activity }) => {
  return (
    <div>
      <p>{activity.name}</p>
      <p>{activity.phone}</p>
      <p>{activity.email}</p>
      <p>${activity.amount}</p>
      {/* Render icons and additional info based on activity.type */}
    </div>
  );
};

export default ActivityItem;
